import React from "react";
import { Container, Name, Price, Bowl } from "./FoodElements";

const Food = ({ id, url, name, price, bowl }) => {
  return (
    <Container>
      <img src={url} alt={name} />
      <Name>{name}</Name>
      <Price>{name}</Price>
      <Bowl>{name}</Bowl>
    </Container>
  );
};

export default Food;
